import './App.css';
import data from "./data"; 

const testData = JSON.parse(data);

function App() {
  return (
    <div className="App">
          <Display></Display>
    </div>
  );
}

const Display = (props)=> {
      return (
              <div>
                {testData}
              </div>
          );

} 
export default App;
